import React from 'react';

const Profile = () => {
  return (
    <div className="relative w-[1440px] h-[1024px] bg-white overflow-hidden">
  {/* Outer Purple Panel */}
  <div className="absolute left-[16.22px] top-[101.68px] w-[1407.56px] h-[820.65px] bg-purple-200/40 rounded-[20px] border border-black shadow-md" />

  {/* Inner White Panels */}
  <div className="absolute left-[50.65px] top-[131.93px] w-[547.14px] h-[758.43px] bg-white rounded-[20px] border border-black shadow-md" />
  <div className="absolute left-[613px] top-[132.79px] w-[783.47px] h-[758.43px] bg-white rounded-[20px] border border-black shadow-md" />
</div>

)
}

export default Profile;
